import React, { useState, useEffect } from "react";
import Navigation from "./components/Navigation";
import BiggestWinsLosses from "./components/BiggestWinsLosses";
import Summary from "./components/Summary";
import "./components/styles/trades.css";

const Trades = ({}) => {
  useEffect(() => {
    fetchTrades(setRecentTrades, showSuccessModal, showUnsuccessModal);
  }, []);
  return (
    <div>
      <div className="navigation-home">
        <Navigation />
      </div>
      <div className="trades">
        <div className="summary-trades">
          <Summary recentTrades={recentTrades} />
        </div>
        <div className="winloss-trades">
          <BiggestWinsLosses recentTrades={recentTrades} />
        </div>
      </div>
    </div>
  );
};

export default Trades;
